package tigerhall

import (
	"testing"
)

func TestCreateImage(t *testing.T) {

	setUP()
	imStAdapter, err := GetImageAdapter()
	if err != nil {
		t.Errorf("Test failed, expected: '%s', got:  '%s'", "created image successfully", err.Error())
	}
	imData := mockDataUploadImage()
	imData.storageAdapter = imStAdapter

	err = imStAdapter.CreateImage(imData)
	if err != nil {
		t.Errorf("Test failed, expected: '%s', got:  '%s'", "created image successfully", err.Error())
	}
}

func mockDataUploadImage() *Image {
	imageData := ImageData{
		Data:   "",
		Format: "base64",
	}
	coreImage, err := imageData.ToCoreImage("jpeg")
	if err != nil {
		panic(err)
	}
	imData := Image{
		Name:      "testImage.jpeg",
		Extension: "jpeg",
		Resource:  "tiger",
		Type:      "tigerhall",
		Data:      *coreImage,
	}
	return &imData
}
